                            <MDBValidationItem className='col-md-4' feedback='Please provide a valid zip.' invalid>
                                <MDBInput wrapperClass='mb-4 w-100' placeholder="이메일 주소를 입력해주세요." label='Email address' id='formControlLg' type='email' size="lg"
                                          name='input_email' value={inputEmail} onChange={handleInputEmail}
                                          required/>
                            </MDBValidationItem>

                            </MDBValidation>
                            <MDBInput wrapperClass='mb-4 w-100' placeholder="비밀번호를 입력해주세요." label='Password' id='formControlLg' type='password' size="lg"
                                      name='input_pw' value={inputPw} onChange={handleInputPw}
                                      required/>

                            <MDBCheckbox name='flexCheck' id='flexCheckDefault' className='mb-4' label='Remember password' />

                            <MDBBtn size='lg' style={{ backgroundColor: '#26B7E6' }} onClick={loginClick}>
                                Login
                            </MDBBtn>

                            <hr className="my-4" />

                            <div className="find-btn">
                                <MDBBtn className='me-1' style={{ backgroundColor: '#26B7E6' }}>
                                    회원가입
                                </MDBBtn>
                                <MDBBtn className='me-1' color='secondary'>
                                    패스워드 찾기
                                </MDBBtn>
                                {/*<MDBBtn className='mx-2' color='tertiary' rippleColor='light'>*/}
                                {/*    Tertiary*/}
                                {/*</MDBBtn>*/}
                            </div>

                        </MDBCardBody>
                    </MDBCard>

                </MDBCol>
            </MDBRow>

        </MDBContainer>
    );
}



export default Login;
